lyears5 = 2014– | nationalteam5 = [[DR Congo national football team|DR Congo]] | nationalcaps5 = 19 | nationalgoals5 = 5 | nationalteam-update = 11 November 2017 }} '''Neeskens Kebano''' (born 10 March 1992) is a professional [[Association football|footballer]] who plays for English club [[Fulham F.C.|Fulham]]. He plays as an [[midfielder|attacking midfielder]] and a [[Midfielder#Winger|winger]]. Kebano is a former [[France national youth football team|French youth international]] having earned caps at [[France national under-17 football team|under-17]], [[France national under-18 football team|under-18]] level, and [[France national under-19 football team|under-19]] level. He made his youth international debut at the [[2008 UEFA European Under-17 Football Championship]].
==Club career==
===Early career=== Kebano was born in the commune of [[Montereau-Fault-Yonne]], Île-de-France. He was given the first name ''Neeskens'' as a homage to the former [[Netherlands national football team|Dutch international]] [[midfielder]] [[Johan Neeskens]] whom his father, Nestor Kebano, was a big admirer of.<ref name="kebano_montereau">{{Cite web | url = http://montereau.typepad.fr/montereau/2006/09/neeskens_kebano.html | title = Neeskens Kebano: "le PSG est une fierté teintée de lucidité" | date = 25 September 2006 | accessdate = 2 February 2011 | publisher = [[Montereau-Fault-Yonne]] | language = French | deadurl = yes | archiveurl = https://web.archive.org/web/20110721022301/http://montereau.typepad.fr/montereau/2006/09/neeskens_kebano.html | archivedate = 21 July 2011 | df = dmy-all }}</ref><ref name ="kebano_future">{{Cite web| url = http://www.fff.fr/selections/m17ans/actualite/528319.shtml | title = Kebano: "Etre digne de cette convocation" | date = 23 March 2009 | accessdate = 2 February 2011 | publisher = [[French Football Federation]] | language = French }}</ref><ref>{{cite news | url = http://www.espoirsdufootball.com/1140-neeskens-kebano-en-hommage-a-johan-neeskens.html | title = Neeskens Kebano en hommage à Johan Neeskens | date = 26 March 2009 | work = Espoirs du Football | accessdate = 2 February 2011 | language = French}}</ref> Kebano was immersed into football at an early age and began his career playing for hometown club ASA Montereau.<ref name ="kebano_montereau"/> While at Montereau, he also competed in judo before opting to focus on football.<ref name ="kebano_future"/> In 2004, Kebano was among a host of players attempting to earn selection to the [[INF Clairefontaine|Clairefontaine]] academy.<ref name ="kebano_psg">{{Cite web| url = http://webcache.googleusercontent.com/search?q=cache:fK4HAw1oHYIJ:lestitisdupsg.spaces.live.com/blog/cns!237F13A51E00435!12725.entry%3F%26_c02_owner%3D1+Neeskens+Kebano+techniquement&cd=25&hl=en&ct=clnk&gl=us&source=www.google.com | title = Interview N°213: Neeskens Kebano | date = 10 October 2009 | accessdate = 2 February 2011 | publisher = Les Titis du PSG | language = French }}</ref> While at the academy's detection camp, he drew interest from [[Paris Saint-Germain F.C.|Paris Saint-Germain]] scout Pierre Reynaud. The club contacted the player and offered him a trial at the club, which he accepted. After spending the 2005 season playing at Montereau, Kebano was contacted again by Paris Saint-Germain who brought him in for a second trial in December 2005. In the following January, the club signed him on an ''aspirant'' (youth) contract and he joined the club in July 2006.<ref name ="kebano_psg"/>
===Paris Saint-Germain=== Kebano began his Paris Saint-Germain career at the club's youth academy in the [[Camp des Loges]]. He was placed on the club's under-14 team and formed friendships with youth and international teammates Jimmy Kamghain, Alassane Tambe, and Bastien Héry.<ref name ="kebano_future"/> The combination of the four were particularly instrumental in their youth team's success. With the under-14 team, Kebano won the ''Championnat Fédéraux de 14 ans''.<ref name ="kebano_psg"/> In the next season with the club's under-15 team, he played on the team that won the [[Double (association football)|league and cup double]]. The team won its league, the Division d'Honneur, and also captured the Coupe de Paris.<ref name ="kebano_psg"/> At under-16 level, Paris Saint-Germain and Kebano won the ''Championnat National des 16 ans''. Though, he is still eligible to compete at youth level, ahead of the [[2010–11 in French football|2010–11 season]], Kebano was promoted to the club's [[Championnat de France amateur]] team in the fourth division. He was also placed onto the club's squad for the [[UEFA Europa League]] being assigned the number 38 shirt by manager [[Antoine Kombouaré]].
Kebano made his amateur debut on 8 August 2010 in a 1–0 victory over [[FC Bourg-Péronnas|Bourg-Péronnas]].<ref>{{cite news | title = Paris SG B v. Bourg-Péronnas Match Report | url = http://www.foot-national.com/fiche-match-football-24081.html | date = 8 August 2010 | work = Foot-National | accessdate = 2 February 2011 }}</ref> The following week, he scored his first amateur goal in a 4–1 win over [[Monts d'Or Azergues Foot|Monts d'Or Azergues]].<ref>{{cite news | title = Monts d'Or Azergues v. Paris SG B Match Report | url = http://www.foot-national.com/fiche-match-football-24089.html | date = 15 August 2010 | work = Foot-National | accessdate = 2 February 2011 }}</ref> After rotating between the club's reserve and [[Coupe Gambardella]] teams in the fall campaign, in December 2011, Kebano was called up to the senior team for the first time to participate in the club's final [[2010–11 UEFA Europa League|Europa League]] group stage match against [[Ukraine|Ukrainian]] club [[FC Karpaty Lviv|Karpaty Lviv]]. He appeared on the substitute's bench, but failed to make his debut as Paris Saint-Germain and Karpaty drew 1–1.<ref>{{cite web | url = http://www.uefa.com/uefaeuropaleague/matches/season=2011/round=2000128/match=2003039/index.html | publisher = [[UEFA|Union of European Football Associations]] | title = Karpaty and PSG make their point |language = French |date = 15 December 2010 | accessdate = 30 January 2011}}</ref> After the winter break, Kebano returned to the club's reserve team and spent January playing with the team. In February 2011, he was called back up to the senior team after being named to the 18-man roster to play amateur club [[FC Martigues|Martigues]] in the [[Coupe de France]]. On 2 February, Kebano made his professional debut in the match appearing as a substitute for [[Mevlüt Erdinç]] in a 4–1 victory.<ref>{{cite news | url = http://www.espoirsdufootball.com/14841-neeskens-kebano-debute-en-pro.html | title = Neeskens Kebano débute en pro | date = 2 February 2011 | work = Espoirs du Football | accessdate = 2 February 2011 | language = French}}</ref><ref>{{cite news | url = http://new.lfp.fr/autresCompetitions/coupeFrance/feuille_match/73932 | title = Martigues v. Paris Saint-Germain Match Report | date = 2 February 2011 | work = [[Ligue de Football Professionnel]] | accessdate = 2 February 2011 | language = French | deadurl = yes | archiveurl = https://web.archive.org/web/20120430194518/http://new.lfp.fr/autresCompetitions/coupeFrance/feuille_match/73932 | archivedate = 30 April 2012 | df = dmy-all }}</ref> He scored his first professional goal for the club on 2 March 2011 in a 2–0 win over [[Le Mans FC|Le Mans]] in the quarter-finals of the Coupe de France.<ref>{{cite news | title = La jeunesse parisienne au pouvoir | url = http://www.rmc.fr/editorial/150612/la-jeunesse-parisienne-au-pouvoir/ | date = 2 March 2011 | work = [[Radio Monte Carlo|RMC Sport]] | accessdate = 2 March 2011 | language = French }}</ref>
On 14 August 2012, Kebano was loaned to [[Ligue 2]] side [[Stade Malherbe Caen|SM Caen]]. As the 2012–13 season ended, Kebano was released to [[R. Charleroi S.C.|Charleroi]].
===Fulham===
On 26 August 2016, Kebano signed for [[Fulham F.C.|Fulham]] on a three-year contract for an undisclosed fee, with a club option for an additional 12 months.<ref>{{cite news|url=https://www.bbc.co.uk/sport/football/37196692|title=Neeskens Kebano: Fulham sign DR Congo forward from Genk|publisher=BBC Sport|date=26 August 2016|accessdate=21 February 2016}}</ref> He scored his first goal for Fulham in a 3–2 win against [[Wigan Athletic]] on 11 February 2017.<ref>{{cite news |url=https://www.bbc.co.uk/sport/football/38865828 |title=Fulham 3–2 Wigan |publisher=BBC |date=11 February 2017 |accessdate=24 February 2017}}</ref>
==International== Kebano is now a DR Congo international player. His first game was against Ivory Coast in Abidjan on 15 October 2014. His team won 3–4 and he scored the very first goal of the game after 23 minutes. In the past he was a [[France national youth football team|French youth international]] having earned caps at [[France national under-17 football team|under-17]], [[France national under-18 football team|under-18]] level, and [[France national under-19 football team|under-19]] level. With the under-17 team, he went unnoticed by coach [[Philippe Bergeroo]] until the [[2009 UEFA European Under-17 Football Championship elite round|Elite Round of qualification]] for the [[2009 UEFA European Under-17 Football Championship]] when he was finally called up to the team.<ref>{{cite news | title = Un nouveau Kebano | url = http://www.fff.fr/selections/m19ans/actualite/535282.shtml | date = 13 October 2010 | work = [[French Football Federation]] | accessdate = 2 February 2011 }}</ref> Kebano made his youth international debut on 24 March 2009 in the team's first Elite Round group stage match against [[Belarus national football team|Belarus]].<ref>{{cite news | url = http://en.archive.uefa.com/competitions/under17/fixturesresults/round=15212/match=304534/report=rp.html | title = Late goals add gloss to France's winning start | date = 24 March 2009 | work = [[UEFA|Union of European Football Associations]] | accessdate = 2 February 2011 }}{{dead link|date=February 2018 |bot=InternetArchiveBot |fix-attempted=yes }}</ref> He appeared in the team's next group stage match against [[Norway national under-17 football team|Norway]] and, after France qualified for the competition, was named to the team to participate in the [[2009 UEFA European Under-17 Football Championship]].<ref name="France step on to Group 7 summit">{{cite news | url = http://en.archive.uefa.com/competitions/under17/fixturesresults/round=15212/match=304548/report=rp.html | title = France step on to Group 7 summit | date = 26 March 2009 | work = [[UEFA|Union of European Football Associations]] | accessdate = 2 February 2011 }}{{dead link|date=February 2018 |bot=InternetArchiveBot |fix-attempted=yes }}</ref> Kebano appeared in all three group stage matches as France were eliminated without procuring a victory. In the team's final group stage match against [[Italy national under-17 football team|Italy]], Kebano scored the opening goal in a 2–1 defeat.<ref name="France step on to Group 7 summit"/>
With the under-18 team, Kebano made his debut on 27 October 2009 in a friendly match against [[Denmark national football team|Denmark]].<ref>{{cite news | title = France v. Denmark Match Report | url = http://www.fff.fr/servfff/fiche_joueur_new/match.php?id_match=145 | date = 27 October 2009 | work = [[French Football Federation]] | accessdate = 2 February 2011 }}</ref> He scored his first goal for the team on 10 December in a 1–1 draw with the [[Ukraine national under-18 football team|Ukraine]].<ref>{{cite news | title = Ukraine v. France Match Report | url = http://www.fff.fr/servfff/fiche_joueur_new/match.php?id_match=167 | date = 10 December 2009 | work = [[French Football Federation]] | accessdate = 2 February 2011 }}</ref> At the 2010 edition of the Copa del Atlantico on the [[Canary Islands]], Kebano scored the second goal in a 4–2 rout of [[Spain national under-18 football team|Spain]].<ref>{{cite news | title = Spain v. France Match Report | url = http://www.fff.fr/servfff/fiche_joueur_new/match.php?id_match=170 | date = 29 January 2010 | work = [[French Football Federation]] | accessdate = 2 February 2011 }}</ref> He finished the under-18 campaign with eight appearances and two goals. Kebano was called up to the under-19 team in August 2010 to play in the Sendai Cup in Japan. He appeared in all three matches as France finished in third place. In October 2010, he played in [[2011 UEFA European Under-19 Football Championship qualification|qualification matches]] for the [[2011 UEFA European Under-19 Football Championship]]. On 10 October, in the team's second group stage match against [[Montenegro national under-19 football team|Montenegro]], Kebano scored the opening goal in a 2–0 victory.<ref>{{cite news | title = France v. Montenegro Match Report | url = http://www.uefa.com/under19/matches/season=2011/round=2000081/match=2001673/index.html | date = 10 October 2010 | work = [[UEFA|Union of European Football Associations]] | accessdate = 13 November 2010 }}</ref>
